A presente INEXIGIBILIDADE DE LICITAÇÃO tem por objeto a atender à necessidade de justificar o pagamento dos emolumentos referentes a serviços notariais e de registro junto ao Cartório Moromizato, sob o CNPJ 26.750.752/0001-63, situado na Quadra 108 Sul, Av. Lo 3, 24 - Plano Diretor Sul, Palmas - TO, 77020-098, indispensáveis para atendimento às demandas administrativas da Capitania Fluvial do Araguaia-Tocantins.
Emolumentos - São as taxas/tarifas fixadas em lei estadual ou distrital que remuneram os
serviços prestados pelos cartórios. Não são preços “livres”; o cartório não pode cobrar quanto quiser.
O valor é definido em tabela oficial aprovada pelo Tribunal de Justiça do respectivo Estado ou pelo
TJDFT (no caso do Distrito Federal).
1.1.2. Serviços notariais e de registros públicos - Abrangem todos os atos praticados por: 
Cartórios de notas (escrituras, procurações, testamentos, autenticações, etc.);
Cartórios de registro civil (nascimento, casamento, óbito, etc.);
Registro de imóveis;
Registro de títulos e documentos;
Protesto de títulos.

Os serviços cartorários (notariais e de registro) são exercidos em caráter exclusivo e delegados pelo poder público, não havendo possibilidade de competição;
2.1.1. O fundamento legal está no art. 74, inciso I, da Lei 14.133/21:
“É inexigível a licitação quando inviável a competição, em especial nos casos de (...)
fornecedor exclusivo.”
2.1.2. E ainda no art. 8º da Lei nº 8.935/1994, que define os cartórios como delegações de serviço público.
